  //   );
  // });
  // console.log(data);

  return (
    <div className='course-review-page'>
      <NavBar />
      {response.status ? (
        <ReviwBody data={response.data} />
      ) : (
        <p>No such data found</p>
      )}
    </div>
  );
};
